() => {
  const result = {
    success: false,
    url: window.location.href,
    userAgent: navigator.userAgent,
    timestamp: new Date().toISOString(),
    captchaType: 'not_found',
    sitekey: null,
    turnstileData: null,
    searchLog: []
  };

  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  // ĞœĞµÑ‚Ğ¾Ğ´ 1: ĞŸÑ€Ğ¾Ğ²ĞµÑ€ĞºĞ° Ğ¿ĞµÑ€ĞµÑ…Ğ²Ğ°Ñ‡ĞµĞ½Ğ½Ñ‹Ñ… Ğ´Ğ°Ğ½Ğ½Ñ‹Ñ… (Challenge Page)
  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  if (window.captchaData && window.captchaData.intercepted && window.captchaData.sitekey) {
    result.success = true;
    result.captchaType = 'challenge_page';
    result.sitekey = window.captchaData.sitekey;
    result.turnstileData = window.captchaData;
    result.searchLog.push('âœ… Method 1: turnstile.render() intercept - SUCCESS');
    return result;
  }
  result.searchLog.push('âŒ Method 1: turnstile.render() intercept - NOT FOUND');

  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  // ĞœĞµÑ‚Ğ¾Ğ´ 2: Standalone Captcha - Ğ¿Ğ¾Ğ¸ÑĞº Ğ¿Ğ¾ ÑĞµĞ»ĞµĞºÑ‚Ğ¾Ñ€Ğ°Ğ¼
  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  const selectors = [
    '[data-sitekey]',
    '[sitekey]',
    'div[class*="turnstile"]',
    'div[class*="cf-turnstile"]',
    'div[id*="turnstile"]',
    'div[id*="cf-turnstile"]',
    'iframe[src*="challenges.cloudflare.com"]',
    'iframe[src*="turnstile"]',
    '.cf-turnstile',
    '#cf-turnstile'
  ];

  for (const selector of selectors) {
    try {
      const element = document.querySelector(selector);
      if (element) {
        result.searchLog.push(`ğŸ” Method 2: Found element with selector: ${selector}`);

        // ĞŸÑ€Ğ¾Ğ²ĞµÑ€ÑĞµĞ¼ data-sitekey
        const sitekey = element.getAttribute('data-sitekey') || 
                       element.getAttribute('sitekey');

        if (sitekey && sitekey.length > 10) {
          result.success = true;
          result.captchaType = 'standalone';
          result.sitekey = sitekey;
          result.elementInfo = {
            tagName: element.tagName,
            className: element.className,
            id: element.id,
            selector: selector
          };
          result.searchLog.push(`âœ… Method 2: Extracted sitekey from ${selector}`);
          return result;
        }

        // ĞŸÑ€Ğ¾Ğ²ĞµÑ€ÑĞµĞ¼ iframe src
        if (element.tagName === 'IFRAME') {
          const src = element.getAttribute('src');
          if (src) {
            const sitekeyMatch = src.match(/[?&]sitekey=([^&]+)/);
            if (sitekeyMatch && sitekeyMatch[1]) {
              result.success = true;
              result.captchaType = 'standalone_iframe';
              result.sitekey = sitekeyMatch[1];
              result.searchLog.push('âœ… Method 2: Extracted from iframe src');
              return result;
            }
          }
        }
      }
    } catch (e) {
      result.searchLog.push(`âš ï¸ Method 2: Error with selector ${selector}: ${e.message}`);
    }
  }
  result.searchLog.push('âŒ Method 2: Selector search - NOT FOUND');

  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  // ĞœĞµÑ‚Ğ¾Ğ´ 3: ĞŸĞ¾Ğ¸ÑĞº Ğ² HTML ĞºĞ¾Ğ´Ğµ ÑÑ‚Ñ€Ğ°Ğ½Ğ¸Ñ†Ñ‹ (Regex)
  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  const htmlContent = document.documentElement.innerHTML;

  const regexPatterns = [
    { name: 'data-sitekey attribute', regex: /data-sitekey=["']([0-9a-zA-Z_-]{10,100})["']/ },
    { name: 'sitekey property', regex: /["']sitekey["'][\s]*:[\s]*["']([0-9a-zA-Z_-]{10,100})["']/ },
    { name: 'sitekey value', regex: /sitekey:[\s]*["']([0-9a-zA-Z_-]{10,100})["']/ },
    { name: 'turnstile render call', regex: /turnstile\.render\([^,]+,[\s]*{[^}]*sitekey:[\s]*["']([^"']+)["']/ },
    { name: '0x pattern', regex: /["']0x[0-9a-zA-Z_-]{10,100}["']/ }
  ];

  for (const pattern of regexPatterns) {
    const match = htmlContent.match(pattern.regex);
    if (match && match[1] && match[1].length >= 10) {
      result.success = true;
      result.captchaType = 'html_extraction';
      result.sitekey = match[1];
      result.searchLog.push(`âœ… Method 3: Found via regex (${pattern.name})`);
      return result;
    }
  }
  result.searchLog.push('âŒ Method 3: HTML regex search - NOT FOUND');

  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  // ĞœĞµÑ‚Ğ¾Ğ´ 4: ĞŸĞ¾Ğ¸ÑĞº Ğ² <script> Ñ‚ĞµĞ³Ğ°Ñ…
  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  const scripts = document.querySelectorAll('script');
  for (let i = 0; i < scripts.length; i++) {
    const script = scripts[i];
    const scriptContent = script.textContent || script.innerHTML;

    if (scriptContent.includes('turnstile') || scriptContent.includes('sitekey')) {
      // Ğ˜Ñ‰ĞµĞ¼ Ğ¿Ğ°Ñ‚Ñ‚ĞµÑ€Ğ½ 0x...
      const match = scriptContent.match(/["']?(0x[0-9a-zA-Z_-]{10,100})["']?/);
      if (match && match[1]) {
        result.success = true;
        result.captchaType = 'script_extraction';
        result.sitekey = match[1];
        result.searchLog.push(`âœ… Method 4: Found in script tag #${i}`);
        return result;
      }
    }
  }
  result.searchLog.push('âŒ Method 4: Script tags search - NOT FOUND');

  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  // ĞœĞµÑ‚Ğ¾Ğ´ 5: ĞŸĞ¾Ğ¸ÑĞº Ñ‡ĞµÑ€ĞµĞ· window.turnstile
  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  if (window.turnstile) {
    try {
      // ĞŸĞ¾Ğ¿Ñ‹Ñ‚ĞºĞ° Ğ½Ğ°Ğ¹Ñ‚Ğ¸ Ğ² window Ğ¾Ğ±ÑŠĞµĞºÑ‚Ğµ
      const turnstileStr = JSON.stringify(window.turnstile);
      const match = turnstileStr.match(/["']?(0x[0-9a-zA-Z_-]{10,100})["']?/);
      if (match && match[1]) {
        result.success = true;
        result.captchaType = 'window_object';
        result.sitekey = match[1];
        result.searchLog.push('âœ… Method 5: Found in window.turnstile');
        return result;
      }
    } catch (e) {
      result.searchLog.push(`âš ï¸ Method 5: Error: ${e.message}`);
    }
  }
  result.searchLog.push('âŒ Method 5: window.turnstile search - NOT FOUND');

  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  // ĞĞ¸Ñ‡ĞµĞ³Ğ¾ Ğ½Ğµ Ğ½Ğ°Ğ¹Ğ´ĞµĞ½Ğ¾
  // â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•â•
  result.error = 'Cloudflare Turnstile sitekey not found on page';
  result.suggestion = 'Try increasing waitTime or check if the page uses Turnstile';

  return result;
}

